import { Reducer } from "../reducerComp/reducer";

function Start() {

    const {dispatch} = useContext(Reducer);

    const startHundler = () => {
        dispatch({type: 'SET_START'});
    }
    return <button className="start-button" onClick={startHundler}>Начать тест</button>
}

